import React, { Component } from 'react';
import { connect } from "react-redux";
import { clearVids } from '../actions/actions';
import { bindActionCreators } from 'redux';

class SearchList extends Component {

    render() {
        return (
            <div>
                <div className="ml-3 mt-3"><i class="fa fa-sliders text-secondary font-weight-bolder" aria-hidden="true"></i><span className="text-secondary ml-2 font-weight-bolder">FILTER</span></div>
                <hr className="bg-secondary w-75 ml-3 mt-2" />
                <ul className="list-unstyled">
                    {this.props.search.map((elem, index) => {
                        return <li className="col-md-8">
                            <div className="row">
                                <div className="p-2 m-3">
                                    <img width="230" height="150" src={elem.snippet.thumbnails.default.url} alt="" />
                                </div>
                                <div>
                                    <span className="ml-2 vidTitle text-white font-weight-bold">{elem.snippet.title}</span>
                                </div>
                            </div>

                        </li>
                    }
                    )}
                </ul>
            </div>
        )
    }
    componentDidMount() {
        this.props.clearVids()
        console.log("load hone ke baad", this.props)
    }
}

const mapStateToProps = (state) => {
    console.log("searchpage state", state)
    return {
        search: state.video.search
    }
}

const mapDispatchToProps = (dispatch) => {
    return bindActionCreators({
        clearVids
    }, dispatch)
}

export default connect(mapStateToProps, mapDispatchToProps)(SearchList)
